import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css';
import FacebookLogin from 'react-facebook-login';



const Lista = () => {
  const responseFacebook = (response) => {
    console.log(response); // Aquí puedes manejar la respuesta de inicio de sesión de Facebook
  };

  return (
    <div>
      <h2>Iniciar sesión con Facebook</h2>
      <FacebookLogin
        appId="EAAIupOuzF2QBAKasCEqmV3mrKuWHzWm9mpxYUwNxBxYh13yVg8VISUrSCldTHafvSyF03jpZAWdnS7mlRj7xyZBBCg1YvtYpDPmq9T36y1jPtwnJjrEXZAXCvM2flGhifkQ9Qkpgeoi9RvSaBTuCIQu3szKtcG5zd2DAAhPZA1w6K1Js3c9xBPmVuM49XeccXldmlNoBwq9RIvTgPVFd7z0uSqtA6mxQv8lbrEOVM7bKEqZBltXE7c6f8L6YfSqcZD"
        autoLoad={false}
        fields="name,email,picture" // Especifica los campos que deseas obtener
        callback={responseFacebook}
      />
    </div>
  );
};


export default Lista;
